function Categories(props){
    return(
        <div className="cat">
            <div>
      
            </div>
            <div>
                <span>All Categories</span>
                {
                    Cat_list&&Cat_list.length >0 &&
                    Cat_list.map((item,index)=>{
                        return (
                            <span onClick={()=> props.handleCategory && props.handleCategory(item)} key={index}>{item}</span>
                        );

                    })
                }
            </div>

        </div>
    );
}
